import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  { title: "e1", description: "Event 1" },
  { title: "e2", description: "Event 2" },
  { title: "e3", description: "Event 3" },
];

function EventsPage() {
    return (
      <>
            <h1>Events Page</h1>
            <ul>
            {
                DUMMY_EVENTS.map((event) => (
                    <li key={event.title}>
                        <Link>
                            
                        </Link>
                    </li>
                ))
            }
            </ul>
           
      </>
    );
}

export default EventsPage;
